import React from 'react';

export default function Portfolio() {
  return (
    <div class='container'>
      <h4 class='my-4'>
        <strong>See My Work</strong> at:{' '}
        <a id='github' href='https://github.com/KirkpatrickPaul'>
          <i class='fab fa-github'></i>Github
        </a>
      </h4>
      <div class='row'></div>
    </div>
  );
}
